void
gegl_dot_node_to_png(GeglNode *node, const gchar *png_path)
{
    GError *error = NULL;

    g_return_if_fail(node != NULL);

    gchar *dot_path = g_find_program_in_path("dot.exe");
    if (!dot_path) {
        g_printerr("Error: 'dot.exe' not found in PATH.\n");
        return;
    }

    // quote the dot path if it contains spaces (Windows-specific)
#ifdef _WIN32
    if (g_strrstr(dot_path, " ")) {
        gchar *quoted_dot_path = g_strdup_printf("\"%s\"", dot_path);
        g_free(dot_path);
        dot_path = quoted_dot_path;
    }
#endif

    gchar *dot_filename = g_strdup_printf("%s.dot", g_get_tmp_dir());
    if (!gegl_node_set(node, dot_filename)) {
        g_printerr("Error saving .dot file: %s\n", dot_filename);
        g_free(dot_path);
        g_free(dot_filename);
        return;
    }

    gchar *argv[] = { dot_path, "-o", (gchar *)png_path, "-Tpng", dot_filename, NULL };

    if (!g_spawn_sync(NULL, argv, NULL, G_SPAWN_SEARCH_PATH, NULL, NULL, NULL, NULL, NULL, &error)) {
        g_printerr("Error executing dot command: %s\n", error->message);
        g_clear_error(&error);
    }

    g_unlink(dot_filename);

    g_free(dot_path);
    g_free(dot_filename);
}


